        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]  # right, down, up, left
    heap = []
    for i in range(N):
        for j in range(N):
            heappush(heap, (grid[i][j], 1, [(grid[i][j], i, j)]))  # (value, path_len, path)
    visited = set()

    while heap:
        value, path_len, path = heappop(heap)
        if (path[-1][1], path[-1][2]) in visited and path_len != k:
            continue
        visited.add((path[-1][1], path[-1][2]))
        if path_len == k:
            return [p[0] for p in path]
        for dx, dy in directions:
            x, y = path[-1][1] + dx, path[-1][2] + dy
            if 0 <= x < N and 0 <= y < N:
                new_path = path + [(grid[x][y], x, y)]
                heappush(heap, (value, path_len + 1, new_path))

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            if i + 1 > len(trib) - 1:  # Calculate trib[i+1] if not exist
                trib.append(1 + (i + 1) / 2)
            trib.append(trib[i - 1] + trib[i - 2] + trib[i + 1])
    return trib

